import Image from 'next/image';

// Emoticon-style SVG icons for services
const serviceIcons = {
  jenkins: 'data:image/svg+xml;base64,',
  jira: 'data:image/svg+xml;base64,',
  svn: 'data:image/svg+xml;base64,',
  health: 'data:image/svg+xml;base64,'
};

interface ServiceIconProps {
  service: 'jenkins' | 'jira' | 'svn' | 'health';
  size?: number;
  className?: string;
}

export default function ServiceIcon({ service, size = 24, className = '' }: ServiceIconProps) {
  return (
    <div className={`inline-block ${className}`} style={{ width: size, height: size }}>
      <Image
        src={serviceIcons[service]}
        alt={`${service} icon`}
        width={size}
        height={size}
        className="w-full h-full"
      />
    </div>
  );
}
